import React from "react";

function Profile(props) {
  const { student } = props;
  return (
    <div>
      {student._id}
      {student.name}
      {student.email}
      {student.age}
      {student.address}
      {student.class_grade}
      {student.password}
    </div>
  );
}

export default Profile;
